              return: {
                description: "2d Array of Strings found",
                type: "String[]"
              },
              example: ["\n<div class=\"norender\">\n<code>\nvar string = 'Hello p5js*! Hello world!';\nvar regexp = 'Hello';\nmatchAll(string, regexp);\n</code>\n</div>"],
